import React from 'react';

const AuthorList = ({ authors }) => {
return (

<ul>
{authors.map(author => (
<li key={author.eid}>
{author.img && <img src={author.img} alt={author.name} />}
<h3>{author.title}</h3>
<p>{author.description}</p>
</li>
))}
</ul>
);
};
export default AuthorList;
